  false,\n\t\"url\": null,\n\t\"notes\": \"This GIS dataset contains point features
  of all Abandoned Uranium Mines (AUMs) on or within one mile of the Navajo Nation.
  Points are centroids developed from the Navajo Nation production mines polygon dataset
  that comprise of productive or unproductive Abandoned Uranium Mines. Attributes
  include mine names, aliases, links to AUM reports, indicators whether an AUM was
  mined above or below ground, indicators whether an AUM was mined above or below
  the local water table, and the region in which an AUM is located. This dataset contains
  608 features.\",\n\t\"owner_org\": \"6d90e48d-3076-4327-b2f4-c33919f374d5\",\n\t\"extras\":
